            <div class="gb-container faq">
                <h2 class="faq__headline">Frequently Asked Questions</h2>
                <div class="gb-col-lg-8">
                    <div class="question">
                        <header>
                            <div class="question__header">
                                <i class="fa fa-angle-down"></i>
                                <span class="question__title">
                                    What is hosting and what is it for?
                                </span>
                            </div>
                        </header>
                        <div style="display:none;">
                            <div class="question__answer">
                                In order for your website to be seen online, you need a web
                                hosting service. Web hosting services differ by how the servers
                                are set up (i.e. the space allocated) and the type of access
                                that people (aka hosting customers) have to them. Every website
                                you’ve ever visited has a website hoster. The main types of
                                website hosting are Shared, Dedicated, VPS and Reseller.
                                <a href="/hosting/what-is-web-hosting-definition/">Learn more about web hosting →</a>
                            </div>
                        </div>
                        <footer></footer>
                    </div>
                    <div class="question">
                        <header>
                            <div class="question__header">
                                <i class="fa fa-angle-down"></i>
                                <span class="question__title"> What is Shared Hosting? </span>
                            </div>
                        </header>
                        <div style="display:none;">
                            <div class="question__answer">
                                Shared Hosting is a type of web hosting where a single physical
                                server hosts multiple websites. Considered the cheapest hosting
                                plan, many users utilize the resources on a single server, which
                                keeps the costs low. Users each get a section of that server
                                where they can host their website files. Shared servers can host
                                hundreds of users. Each customer who uses the Shared Hosting
                                server has access to such features as databases, monthly traffic
                                reports, disk space, email accounts, FTP accounts, and other
                                add-ons offered by the hosting provider. System resources are
                                shared on-demand by users on the server, where each one gets a
                                percentage of everything from RAM and CPU as well as the single
                                MySQL, Apache, and mail servers.
                                <a href="hosting/shared/">Learn more about cheap hosting plans →
                                </a>
                            </div>
                        </div>
                        <footer></footer>
                    </div>
                    <div class="question">
                        <header>
                            <div class="question__header">
                                <i class="fa fa-angle-down"></i>
                                <span class="question__title">
                                    What is WordPress Hosting?
                                </span>
                            </div>
                        </header>
                        <div style="display:none;">
                            <div class="question__answer">
                                <a href="/wordpress/">Managed WordPress Hosting</a> simply means
                                that all technical aspects of running a WordPress website are
                                taken care of (i.e. managed) by the web hosting provider.
                                Namecheap’s Managed WordPress Hosting, EasyWP, also features a
                                user-friendly dashboard that allows you to update, manage, and
                                back up all of your future installations. This means that you
                                don’t have to figure out how to use a control panel (cPanel or
                                Plesk) to manage your website. (As a friendly reminder, cPanel
                                is a dashboard that is used to control your hosting
                                environment.)
                            </div>
                        </div>
                        <footer></footer>
                    </div>
                    <div class="question">
                        <header>
                            <div class="question__header">
                                <i class="fa fa-angle-down"></i>
                                <span class="question__title"> What is VPS Hosting? </span>
                            </div>
                        </header>
                        <div style="display:none;">
                            <div class="question__answer">
                                <a href="/hosting/vps/">VPS Hosting</a> is a type of web hosting
                                that’s suited for those who have outgrown Shared Hosting. Since
                                multiple websites reside on a single web server with Shared
                                Hosting, with no guarantee of resources, VPS Hosting allows for
                                fewer users to share allocated resources of hard drive space,
                                memory, and processor power. Each user on a VPS server has
                                access to a virtual machine that runs on its own copy of an
                                Operating System (OS). This lets VPS Hosting customers
                                experience similar capabilities and performance levels of a
                                Dedicated Server for their web hosting services.
                            </div>
                        </div>
                        <footer></footer>
                    </div>
                    <div class="question">
                        <header>
                            <div class="question__header">
                                <i class="fa fa-angle-down"></i>
                                <span class="question__title"> What is Reseller Hosting? </span>
                            </div>
                        </header>
                        <div style="display:none;">
                            <div class="question__answer">
                                <a href="/hosting/reseller/">Reseller Hosting</a> is a form of
                                web hosting where the account owner has the ability to use their
                                allotted hard drive space and bandwidth to host websites on
                                behalf of third parties. In other words, the reseller purchases
                                the hosting provider’s wholesale services and then sells them to
                                their clients/customers for a profit. Want more info?
                                <a href="/support/knowledgebase/article.aspx/9391/27/reseller-hosting-getting-started/">Check
                                    out Namecheap's “Getting Started” guide for Reseller
                                    Hosting</a>.
                            </div>
                        </div>
                        <footer></footer>
                    </div>
                    <div class="question">
                        <header>
                            <div class="question__header">
                                <i class="fa fa-angle-down"></i>
                                <span class="question__title">
                                    Why should I use Email Hosting from Namecheap?
                                </span>
                            </div>
                        </header>
